import React from "react";
import { Form, Row, Col } from "react-bootstrap";
export const SearchForm = () => {
  return (
    <div>
      <Form>
        <Form.Group as={Row}>
          <Form.Label column ms="2">
            <h1>Search:</h1>
          </Form.Label>
          <Col ms="10">
            <Form.Control
              name="searchStr"
              placeholder="Rechercher ..."
            ></Form.Control>
          </Col>
        </Form.Group>
      </Form>
    </div>
  );
};
